import "../App.css";
import React from "react";

function Forecast(props) {
  const check = () => {
    console.log(props.Forecast);
  };

  return (
    <div style={props.background} className="forecast">
      <div className="tomorrow">{check}</div>
      <div className="futureDays"></div>
    </div>
  );
}

export default Forecast;
